  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Alaska
  Peninsula NWR outlines Refuge accomplishments during the 1983 calendar year. The
  report begins with a summary of the year's highlights and weather conditions. Land
  acquisition is covered. The report includes a planning section which discusses the
  master plan, management planning, public participation, and compliance with environmental
  and cultural resource mandates. Refuge administration is outlined; information about
  personnel, youth programs, manpower programs, funding, and safety is given. Habitat
  management is also covered; subjects include wetlands, forests, and wilderness areas.
  The wildlife section of the report discusses wildlife diversity, endangered and
  threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, marine mammals, fisheries resources, and marking and bird banding.
  The public uses of the Refuge described in this report include interpretive programs,
  hunting, fishing, trapping, wildlife observation, outdoor recreation, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, major maintenance, equipment replacement, communication
  systems, and energy conservation. Cooperative programs and items of interest are
  provided at the end.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
